import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { 
  NeuHeading, 
  NeuText, 
  NeuPrimaryButton,
  ContentContainer,
  NeuAnimatedContainer,
  NeuCard,
  NeuImageContainer
} from '../components/NeumorphicElements';
import { useAppContext } from '../context/AppContext';
import { getCardPhotos } from '../utils/photos';
import theme from '../styles/GlobalStyles';

// Card styled components
const CardContainer = styled(NeuAnimatedContainer)`
  text-align: center;
  position: relative;
  overflow: visible;
  background: linear-gradient(145deg, ${theme.colors.background}, ${theme.colors.primary}10);
`;

const CardFrontContent = styled(motion.div)`
  position: relative;
  width: 100%;
  perspective: 2000px;
  transform-style: preserve-3d;
`;

const CardCover = styled(motion.div)`
  position: relative;
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  backface-visibility: hidden;
  padding: ${theme.spacing.xl};
  z-index: 1;
`;

const CardTitle = styled(NeuHeading)`
  font-size: 2.5rem;
  margin-bottom: ${theme.spacing.md};
  background: linear-gradient(to right, ${theme.colors.primary}, ${theme.colors.secondary});
  -webkit-background-clip: text;
  background-clip: text;
  -webkit-text-fill-color: transparent;
  text-shadow: none;
  text-align: center;

  @media (max-width: ${theme.breakpoints.mobile}) {
    font-size: 1.8rem;
  }
`;

const CardSubtitle = styled(NeuText)`
  font-size: 1.2rem;
  margin-bottom: ${theme.spacing.xl};

  @media (max-width: ${theme.breakpoints.mobile}) {
    font-size: 1rem;
  }
`;

const CardPhoto = styled(NeuImageContainer)`
  width: 100%;
  max-width: 300px;
  margin: ${theme.spacing.md} auto;
  overflow: hidden;
  aspect-ratio: 1 / 1;

  img {
    transition: transform 0.5s ease;
  }

  &:hover img {
    transform: scale(1.05);
  }
`;

const CardButtons = styled.div`
  display: flex;
  justify-content: center;
  margin-top: ${theme.spacing.xl};
`;

const CelebrationEmoji = styled.div`
  position: absolute;
  font-size: 3rem;
  opacity: 0.3;
  transform: rotate(${() => Math.random() * 30 - 15}deg);

  &.cake {
    top: 10%;
    right: 10%;
  }

  &.gift {
    bottom: 15%;
    left: 5%;
  }

  &.balloon {
    top: 5%;
    left: 10%;
  }

  &.party {
    bottom: 10%;
    right: 15%;
  }
`;

const CardFront: React.FC = () => {
  const { state, openCard } = useAppContext();
  const navigate = useNavigate();
  const [isOpening, setIsOpening] = useState(false);
  const cardPhotos = getCardPhotos();
  const mainPhoto = cardPhotos[0];

  const handleOpenCard = () => {
    setIsOpening(true);
    setTimeout(() => {
      openCard();
      navigate('/inside');
    }, 800);
  };

  // Animation variants
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1,
      transition: { 
        duration: 0.6,
        staggerChildren: 0.1
      }
    },
    exit: { 
      opacity: 0,
      rotateY: -180,
      transition: { duration: 0.8 }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <ContentContainer>
      <CardContainer
        variants={containerVariants}
        initial="hidden"
        animate="visible"
        exit="exit"
      >
        <CardFrontContent
          animate={isOpening ? { rotateY: -180 } : { rotateY: 0 }}
          transition={{ duration: 0.8 }}
        >
          <CardCover>
            <CelebrationEmoji className="cake">üéÇ</CelebrationEmoji>
            <CelebrationEmoji className="gift">üéÅ</CelebrationEmoji>
            <CelebrationEmoji className="balloon">üéà</CelebrationEmoji>
            <CelebrationEmoji className="party">üéâ</CelebrationEmoji>

            <motion.div variants={itemVariants}>
              <CardTitle>Happy Birthday!</CardTitle>
            </motion.div>

            <motion.div variants={itemVariants}>
              <CardSubtitle>
                To an amazing father, doctor, and inspiration.
              </CardSubtitle>
            </motion.div>

            <motion.div variants={itemVariants}>
              <CardPhoto>
                {mainPhoto && <img src={mainPhoto.src} alt={mainPhoto.title} />}
              </CardPhoto>
            </motion.div>

            <motion.div variants={itemVariants}>
              <CardButtons>
                <NeuPrimaryButton onClick={handleOpenCard}>
                  Open Card
                </NeuPrimaryButton>
              </CardButtons>
            </motion.div>
          </CardCover>
        </CardFrontContent>
      </CardContainer>
    </ContentContainer>
  );
};

export default CardFront;
